import React from 'react';
import { Navigate } from 'react-router-dom';
import axios from 'axios';
import { Link } from 'react-router-dom';
// import EnqCard from '../components/EnqCard';

export default class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            email: "",
            senha: "",
        };
        // this.handleInputChange = this.handleInputChange.bind(this);
        // this.handleSubmit = this.handleSubmit.bind(this);
    }

render() {
    return (
        <div>
            <h1 className='Title'>email</h1>
            <h2 className='Title'>senha</h2>
            <form
            // onSubmit={this.handleSubmit}
            >
                <label>
                    <b>Email</b>
                    <br />
                    <input name="email" placeholder="Digite seu Email" onChange={this.handleInputChange} value={this.state.email} type='text'></input>
                    <br />
                    <b>Senha</b>
                    <br />
                    <input name="senha" placeholder="Digite sua Senha" onChange={this.handleInputChange} value={this.state.senha} type='text'></input>
                    <Link className='Title' to='/register'><h2>Registrar</h2></Link>
                    {/* <EnqCard data={enquetes} /> */}
                </label>
            </form>
            <button className="button" onClick={this.handleSubmit}>
                Logar
            </button>
            {this.state.errorMessage !== '' ?
                <p className="red">{this.state.errorMessage}</p>
                : null}
            {this.state.submitedMessage !== '' ?
                <div>
                    <p className="green">
                        Usu√°rio logado.
                    </p>
                </ div>
                : null}
        </div >
    );
